const PautaCard = styled.div`
  background: #fff;
  padding: 10px;
  margin: 10px;
  border-radius: 5px;
`;

const Pauta = ({ titulo, votos }) => (
  <PautaCard>
    <h3>{titulo}</h3>
    <p>Votos Sim: {votos.sim} | NÃ£o: {votos.nao}</p>
  </PautaCard>
);

export default Pauta;
